    const content = Array.isArray(ibanStates) ?
      ibanStates.map((ibanState) =>
        <div key={++index}>
            <div>{ibanState.iban}</div>
            <div style="font-weight: bold">{ibanState.state}</div>
        </div>
      ) : 'No response from server...';

    return(
      <div>
        {content}
      </div>
    )
  }
}

export default IbanValidationResult;
